import Layout from "../components/Layout";

function HomePage() {
  return (
    <Layout>
      <h1>Contact me!</h1>
      <form action="/">
        <label>Name:</label>
        <input type="text" id="name" />

        <label>Email:</label>
        <input type="email" id="email" />

        <label>Subject:</label>
        <input type="text" id="subject" />

        <label>Text:</label>
        <textarea id="text" />

        <button type="submit">Send</button>
      </form>
      <style jsx>
        {`
          form {
            display: grid;
            grid-gap: 1em;
            max-width: 70%;
            justify-content: center;
            flex-direction: column;
          }

          input {
            border: none;
            background: #e2e8f0;
            justify-self: end;
            width: 100%;
            height: 2vmax;
          }

          button {
            width: max-content;
            margjustify-self: center;
          }

          textarea {
            border: none;
            background: #e2e8f0;
            height: 5em;
          }
        `}
      </style>
    </Layout>
  );
}

export default HomePage;
